// src/components/Auth/SignUp.js
import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom'; // Importa useNavigate
import '../../styles.css'; // Asegúrate de importar el archivo CSS

const Signup = () => {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate(); // Hook para navegación

  const handleSignup = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/auth/signup', {
        username,
        email,
        password,
      });
      console.log(`Bienvenido ${response.data.username}`); // Cambié `response.username` por `response.data.username`
      alert('User created successfully!');

      // Redirige al usuario a Dashboard
      navigate('/dashboard');
    } catch (error) {
      // Manejo mejorado de errores
      if (error.response && error.response.data) {
        console.error('Signup error:', error.response.data);
        alert(`Signup error: ${error.response.data.error || 'An error occurred'}`);
      } else {
        console.error('Signup error:', error);
        alert('Signup error: An unexpected error occurred');
      }
    }
  };

  return (
    <section className="py-12 py-lg-24 py-xl-32 position-relative overflow-hidden" style={{ backgroundColor: '#0798A3' }}>
      <div className="container">
        <div className="row align-items-center">
          {/* Imagen y texto en el lado izquierdo */}
          <div className="col-lg-6 order-last order-lg-first">
            <div className="mw-md mw-xl-none position-relative">
              <div className="position-absolute bottom-0 start-0 w-100 p-6">
                <div className="py-10 px-6 px-sm-10 bg-dark bg-opacity-25 rounded">
                  <h6 className="text-white">IA para analizar dibujos</h6>
                  <p className="fs-5 text-white fw-semibold mb-14">"Sistemas de inteligencia artificial diseñados para interpretar y comprender imágenes... utilizan técnicas de visión por computadora y aprendizaje automático para extraer..."</p>
                </div>
              </div>
              <img className="img-fluid d-block w-100" style={{ minHeight: 620, objectFit: 'cover' }} src="https://content.cuerpomente.com/medio/2022/09/08/dibujo-nino_6db16aa5_1200x1200.jpg" alt="Sign Up" />
            </div>
          </div>

          {/* Formulario de Sign Up a la derecha */}
          <div className="col-lg-6 mb-12 mb-lg-0">
            <div className="mw-md mw-xl-lg ms-xl-auto">
              <h5 className="font-heading mb-4 text-white text-center">Create your account</h5>
              <form onSubmit={handleSignup}>
                <div className="mb-4">
                  <label className="fw-semibold fs-9 mb-1 text-black" htmlFor="username">Username</label>
                  <input 
                    className="form-control" 
                    type="text" 
                    value={username}
                    onChange={(e) => setUsername(e.target.value)} 
                    id="username" 
                    placeholder="Enter your username" 
                    required 
                  />
                </div>

                <div className="mb-4">
                  <label className="fw-semibold fs-9 mb-1 text-black" htmlFor="email">Email</label>
                  <input 
                    className="form-control" 
                    type="email" 
                    value={email}
                    onChange={(e) => setEmail(e.target.value)} 
                    id="email" 
                    placeholder="example@gmail.com" 
                    required 
                  />
                </div>

                <div className="mb-4">
                  <label className="fw-semibold fs-9 mb-1 text-black" htmlFor="password">Password</label>
                  <input 
                    className="form-control" 
                    type="password" 
                    value={password}
                    onChange={(e) => setPassword(e.target.value)} 
                    id="password" 
                    placeholder="Enter your password" 
                    required 
                  />
                </div>

                <button className="btn btn-primary mb-6 w-100 rounded-pill" type="submit">Sign Up</button>

                <p className="fs-10 fw-semibold text-center text-black">
                  <span>Already have an account?</span>
                  <a className="btn btn-link fw-semibold fs-10 p-0" href="/login">Login</a>
                </p>
              </form>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Signup;
